import React from "react";
import ReactDOM from "react-dom";
import Card from "./card";
import contacts from "../contacts";

function Caard(params) {
  <Card name={contacts.name} imgurl={contacts.imgURL} phone={contacts.phone} email = {contacts.email} />

}

function App(params) {
  return <div>
   {contacts.map(Caardard)}
   </div>
}

export default App;
